// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract Voting {
    address public owner;
    bool public electionActive;
    uint256 public electionStart;
    uint256 public electionEnd;

    struct Candidate {
        string name;
        uint256 votes;
        bool active;
    }

    Candidate[] private candidates;

    mapping(address => bool) public isWhitelisted;
    mapping(address => bool) public hasVoted;
    mapping(address => uint256) public votedCandidate;
    mapping(address => uint256) public votedAt;

    event Whitelisted(address indexed voter);
    event WhitelistBatch(uint256 count);
    event CandidateAdded(uint256 indexed candidateIndex, string name);
    event CandidateRemoved(uint256 indexed candidateIndex);
    event ElectionStarted(uint256 startTime);
    event ElectionEnded(uint256 endTime);
    event VoteCast(address indexed voter, uint256 indexed candidateIndex);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner");
        _;
    }

    modifier onlyWhileActive() {
        require(electionActive, "Election not active");
        _;
    }

    constructor(string[] memory initialCandidates) {
        owner = msg.sender;
        for (uint256 i = 0; i < initialCandidates.length; i++) {
            _addCandidate(initialCandidates[i]);
        }
    }

    function startElection() external onlyOwner {
        require(!electionActive, "Election already active");
        electionActive = true;
        electionStart = block.timestamp;
        electionEnd = 0;
        emit ElectionStarted(electionStart);
    }

    function endElection() external onlyOwner {
        require(electionActive, "Election already ended");
        electionActive = false;
        electionEnd = block.timestamp;
        emit ElectionEnded(electionEnd);
    }

    function whitelist(address voter) public onlyOwner {
        require(voter != address(0), "Invalid address");
        isWhitelisted[voter] = true;
        emit Whitelisted(voter);
    }

    function whitelistBatch(address[] calldata voters) external onlyOwner {
        require(voters.length > 0, "Empty list");
        for (uint256 i = 0; i < voters.length; i++) {
            address voter = voters[i];
            if (voter != address(0)) {
                isWhitelisted[voter] = true;
                emit Whitelisted(voter);
            }
        }
        emit WhitelistBatch(voters.length);
    }

    function addCandidate(string calldata name) external onlyOwner {
        _addCandidate(name);
    }

    function removeCandidate(uint256 candidateIndex) external onlyOwner {
        require(candidateIndex < candidates.length, "Invalid candidate");
        require(candidates[candidateIndex].active, "Already removed");
        candidates[candidateIndex].active = false;
        emit CandidateRemoved(candidateIndex);
    }

    function vote(uint256 candidateIndex) external onlyWhileActive {
        require(isWhitelisted[msg.sender], "Not whitelisted");
        require(!hasVoted[msg.sender], "Already voted");
        require(candidateIndex < candidates.length, "Invalid candidate");
        require(candidates[candidateIndex].active, "Candidate inactive");

        hasVoted[msg.sender] = true;
        votedCandidate[msg.sender] = candidateIndex;
        votedAt[msg.sender] = block.timestamp;
        candidates[candidateIndex].votes += 1;

        emit VoteCast(msg.sender, candidateIndex);
    }

    function candidateCount() external view returns (uint256) {
        return candidates.length;
    }

    function activeCandidateCount() external view returns (uint256) {
        uint256 count = 0;
        for (uint256 i = 0; i < candidates.length; i++) {
            if (candidates[i].active) {
                count += 1;
            }
        }
        return count;
    }

    function candidateInfo(uint256 candidateIndex)
        external
        view
        returns (string memory name, uint256 votes, bool active)
    {
        require(candidateIndex < candidates.length, "Invalid candidate");
        Candidate memory candidate = candidates[candidateIndex];
        return (candidate.name, candidate.votes, candidate.active);
    }

    function voterStatus(address voter)
        external
        view
        returns (bool whitelisted, bool voted, uint256 candidateIndex, uint256 timestamp)
    {
        return (
            isWhitelisted[voter],
            hasVoted[voter],
            votedCandidate[voter],
            votedAt[voter]
        );
    }

    function getWinner()
        external
        view
        returns (uint256 winnerIndex, string memory name, uint256 votes, bool hasTie, bool hasWinner)
    {
        uint256 topVotes = 0;
        uint256 topIndex = 0;
        bool tie = false;
        bool found = false;

        for (uint256 i = 0; i < candidates.length; i++) {
            Candidate memory candidate = candidates[i];
            if (!candidate.active) {
                continue;
            }
            if (!found || candidate.votes > topVotes) {
                topVotes = candidate.votes;
                topIndex = i;
                tie = false;
                found = true;
            } else if (candidate.votes == topVotes) {
                tie = true;
            }
        }

        if (!found) {
            return (0, "", 0, false, false);
        }

        return (topIndex, candidates[topIndex].name, topVotes, tie, true);
    }

    function _addCandidate(string memory name) internal {
        require(bytes(name).length > 0, "Empty name");
        candidates.push(Candidate({name: name, votes: 0, active: true}));
        emit CandidateAdded(candidates.length - 1, name);
    }
}
